TEST_F(FourierTest, PowerOfTwo){
    EXPECT_EQ(fourier_1d.__is_power_of_2((unsigned int) 1), true);
    EXPECT_EQ(fourier_1d.__is_power_of_2((unsigned int) 2), true);
    EXPECT_EQ(fourier_1d.__is_power_of_2((unsigned int) 4), true);
    EXPECT_EQ(fourier_1d.__is_power_of_2((unsigned int) 8), true);
    EXPECT_EQ(fourier_1d.__is_power_of_2((unsigned int) 17), false);
    EXPECT_EQ(fourier_1d.__is_power_of_2((unsigned int) 256), true);
}

TEST_F(FourierTest, NextPowerOfTwo){
    EXPECT_EQ(fourier_1d.__next_power_of_2((unsigned int) 1), 1);
    EXPECT_EQ(fourier_1d.__next_power_of_2((unsigned int) 2), 2);
    EXPECT_EQ(fourier_1d.__next_power_of_2((unsigned int) 6), 8);
    EXPECT_EQ(fourier_1d.__next_power_of_2((unsigned int) 10), 16);
    EXPECT_EQ(fourier_1d.__next_power_of_2((unsigned int) 20), 32);
}

TEST_F(FourierTest, Transform1D){
    double residual = (sine_wave_60Hz_fft_result - fourier_1d.get_fft_result<double>()).norm();   
    ASSERT_NEAR(residual, 3e-14, 1e-14);
}

TEST_F(FourierTest, InverseTransform1D){
    EXPECT_EQ(sine_wave_60Hz.isApprox(fourier_1d.get_inverse_result<double>()), true);
}

TEST_F(FourierTest, Transform2D){
    double residual = (random_normal_64x64_image_fft_result - fourier_2d.get_fft_result<double>()).norm();   
    ASSERT_NEAR(residual, 1e-12, 1e-12);
}

TEST_F(FourierTest, InverseTransform2D){
    double residual = (random_normal_64x64_image - fourier_2d.get_inverse_result<double>()).norm();   
    ASSERT_NEAR(residual, 9e-15, 2e-15);
}

TEST_F(FourierTest, LoadingWAV){
    double residual = (wav_file.getData() - fourier_wav.get_signal<double>()).norm();
    ASSERT_NEAR(residual, 1e-16, 1e-16);
}

TEST_F(FourierTest, LoadingPNG){
    double residual = (png_file.getData() - fourier_png.get_signal<double>()).norm();
    ASSERT_NEAR(residual, 1e-16, 1e-16);
}
